import React from 'react';
import { NavLink } from 'react-router-dom';
import Management from './Management';
import ShowCheck from './ShowCheck';

const Management_SubMenu = () => {
    const activeStyle = {
        color: 'blue',
        fontSize: '1rem'
    };

    return (
        <div>
            
            <ul>
                <li><NavLink to="/" activeStyle={activeStyle}>관리</NavLink></li>
                <li><NavLink to="/Management" activeStyle={Management}>예매관리</NavLink></li>
                <li><NavLink to="/ShowCheck" component={ShowCheck}>검표</NavLink></li>
                <li><NavLink to="/ReviewManagement" activeStyle={activeStyle}>분석</NavLink></li>
            </ul>
            <hr/>
        </div>
    );
};

export default Management_SubMenu;
